import React from "react";

function Card(props) {
    return (
        <div>
            <div className="card mb-3">
                <h3 className="card-header">{props.title}</h3>
                <div className="card-body">
                    {props.children}
                </div>
            </div>
        </div>
    );
}

export default Card;
